const { createCanvas, loadImage } = require('canvas');

// Función para comparar imágenes en Base64 y obtener el porcentaje de similitud
async function compararImagenes(base64Image1, base64Image2) {
  const image1 = await loadImage(base64Image1);
  const image2 = await loadImage(base64Image2);

  const canvas1 = createCanvas(image1.width, image1.height);
  const canvas2 = createCanvas(image2.width, image2.height);

  const ctx1 = canvas1.getContext('2d');
  const ctx2 = canvas2.getContext('2d');

  ctx1.drawImage(image1, 0, 0);
  ctx2.drawImage(image2, 0, 0);

  const imageData1 = ctx1.getImageData(0, 0, canvas1.width, canvas1.height).data;
  const imageData2 = ctx2.getImageData(0, 0, canvas2.width, canvas2.height).data;

  const pixelCount = canvas1.width * canvas1.height * 4;
  let matchingPixels = 0;

  for (let i = 0; i < pixelCount; i++) {
    if (imageData1[i] === imageData2[i]) {
      matchingPixels++;
    }
  }

  const similarityPercentage = (matchingPixels / pixelCount) * 100;
  return similarityPercentage.toFixed(2);
}

// Ejemplo de uso
const base64Image1 = "data:image/png;base64,"; // Primera imagen en Base64
const base64Image2 = "data:image/png;base64,"; // Segunda imagen en Base64

compararImagenes(base64Image1, base64Image2)
  .then((percentage) => {
    console.log("Porcentaje de similitud:", percentage + "%");
  })
  .catch((error) => {
    console.error("Error al comparar imágenes:", error);
  });

